"MSG_ALL_UNPAID_SENT" => "Wszystkie niezapłacone faksy zostały wysłane.",
"MSG_APIACCOUNTCREATION_BODY" => "Thank you for your registration to the PamFax Developer Program. An account has been created so that you can start exploring the rich PamFax API right away.\n\nYou can now log in at the <a href=\"https://sandbox-apifrontend.pamfax.biz\">PamFax API frontend</a> to access the documentation, download sample code and test the API.\n\nYour API credentials are:\nAPI key: {apikey}\nAPI secret word: {apisecret}\n\nPlease note that the sandbox database does not contain any data from the live environment. It is a separate system. The sandbox API does not really sent faxes. Randomly, some of your faxes will fail in the sandbox to let you test the failure case. Most of the faxes will just be reported as successfully sent, although the fax never really was sent.\nThis also applies to PamFax Credit in the sandbox - it's just virtual money. You can add as much PamFax Credit to your PamFax test account using the function Shopping/AddCreditToUser as you want. You can then use the PamFax Credit to test the sending process. We also provide a test fax number so you can test receiving faxes.\n\nWe have created a new PamFax user for you in the production system and sandbox system with PamFax Credit for testing purposes:\nUsername: {username}\nPassword: {password}\n\nOnce you have completed the development, send us an email to devsupport@pamfax.biz with a description of the solution and a few screenshots. We will review your solution and will enable access to the production system. It is a short and uncomplicated process.\n\nNeed help? We've created a <a href=\"https://groups.google.com/d/forum/pamfax-api-partners\">moderated mailing list for all PamFax API developers</a>. For 1:1 support or problems with your PamFax account, just send us an email to <a href=\"mailto:devsupport@pamfax.biz\">devsupport@pamfax.biz</a>",
"MSG_APIACCOUNTCREATION_SUBJECT" => "Witaj w programie dla twórców PamFax",
"MSG_AUTOTOPUP" => "{credit} zostało automatycznie przekazane z konta firmowego {company} do {username}",
"MSG_BASICPLAN_EXTENDED" => "Dziękujemy za przedłużenie twojego planu PamFax Basic dla następującego numer faksu:\n\n\n\n<b>{number}</b>\n\n\n\nna kolejne {months} miesięcy. Numer wygaśnie {expiredate}. Wygaśnięcie planu nie wpływa na środki PamFax na twoim koncie lub możliwość wysyłania faksów. Plan jest osobną subskrypcją i nie jest powiązany z twoimi środkami PamFax na koncie.",
"MSG_BASICPLAN_PURCHASED" => "Dziękujemy za zakup planu PamFax Basic, został on uaktywniony na kolejne {months} miesięcy. \n\n\n\nOtrzymasz informację e-mailową lub na Skype zaraz po uaktywnieniu twojego numeru faksu.\n\n\n\nTwoje korzyści:\n\n- {months} miesięczna subskrypcja\n\n- Darmowe i nielimitowane odbieranie faksów\n\n- Miejsce na wysłane i otrzymane faksy z 30 dni\n\n- Brak reklam\n\n\n\nPlan zakończy się {expiredate}. Zostaniesz automatycznie powiadomiony o wygasaniu subskrypcji, tak abyś zdążył przedłużyć jej okres i zachować swój numer. Wygaśnięcie planu nie wpływa na środki PamFax na twoim koncie lub \n\nmożliwość wysyłania faksów. Plan jest osobną subskrypcją i nie jest \n\npowiązany z twoimi środkami PamFax na koncie. Miej na uwadze, że na wyciągu z twojej karty kredytowej może pojawić się pozycja transakcji opisana jako \"GTS Pamela. Nicosia\". Jest to poprawne oznaczenie i oznacza transakcję powiązana z PamFax.",
"MSG_BASICPLAN_REFUNDED" => "Twoje zamówienie {order_id} planu PamFax Basic zostało zwrócone. Data wygaśnięcia planu to {expiredate}.\n\nNie ma to wpływu na twoją zdolność do wysyłania faksów: twoje konto PamFax jest nadal aktywne i umożliwia wysyłanie faksów.",
"MSG_BCP_DELETE" => "Jeśli usuniesz swoje konto firmowe, wszyscy użytkownicy zostaną także usunięci. PamFax powiadomi wszystkich użytkowników, że konto firmowe zostało rozwiązane. Użytkownicy zachowają środki, które zostały im przez ciebie przekazane.",
