"MSG_CREDIT_EXPIRATION_WARNING_1" => "Wygląda na to, że nie korzystałeś ze swoich środków PamFax przez dłuższy czas. Staną się one nieaktywne, jeśli nie zostaną napoczęte w ciągu 180 dnia. Pozostało Ci {days_to_expiration} dni, nim twoje środki staną się nieaktywne.\n\nJak utrzymać stan środków jako aktywny? To proste. Wykonaj jedną z poniższych czynności, a twoje środki będą aktywne przez kolejne 180 dni:\n\n- Wyślij dokument lub stronę tytułową (na prawidłowy lub nieprawidłowy numer)\n- Zakup pakiet doładowujący PamFax lub plan w naszym sklepie na {shop_url}",
"MSG_CREDIT_EXPIRATION_WARNING_2" => "Wygląda na to, że nie korzystałeś ze swoich środków PamFax przez dłuższy czas. Staną się one nieaktywne, jeśli nie zostaną napoczęte w ciągu 180 dnia. Pozostało Ci {days_to_expiration} dni, nim twoje środki staną się nieaktywne.\n\nJak utrzymać stan środków jako aktywny? To proste. Wykonaj jedną z poniższych czynności, a twoje środki będą aktywne przez kolejne 180 dni:\n\n- Wyślij dokument lub stronę tytułową (na prawidłowy lub nieprawidłowy numer)\n- Zakup pakiet doładowujący PamFax lub plan w naszym sklepie na {shop_url}",
"MSG_CREDIT_EXPIRATION_WARNING_3" => "Wygląda na to, że nie korzystałeś ze swoich środków PamFax przez dłuższy czas. Staną się one nieaktywne, jeśli nie zostaną napoczęte w ciągu 180 dnia. Pozostało Ci 48 godzin, nim twoje środki staną się nieaktywne.\n\nJak utrzymać stan środków jako aktywny? To proste. Wykonaj jedną z poniższych czynności, a twoje środki będą aktywne przez kolejne 180 dni:\n\n- Wyślij dokument lub stronę tytułową (na prawidłowy lub nieprawidłowy numer)\n- Zakup pakiet doładowujący PamFax lub plan w naszym sklepie na {shop_url}",
"MSG_CREDIT_EXPIRATION_WARNING_EMAIL_1" => "Wygląda na to, że nie korzystałeś ze swoich środków PamFax przez dłuższy czas. Staną się one nieaktywne, jeśli nie zostaną napoczęte w ciągu 180 dnia. Pozostało Ci <b>{days_to_expiration}</b> dni, nim twoje środki staną się nieaktywne.\n\nJak utrzymać stan środków jako aktywny? \nTo proste. Wykonaj jedną z poniższych czynności, a twoje środki będą aktywne przez kolejne 180 dni:\n\n- Wyślij dokument lub stronę tytułową (na prawidłowy lub nieprawidłowy numer)\n- Zakup pakiet doładowujący PamFax lub plan w naszym sklepie na {shop_url}",
"MSG_CREDIT_EXPIRATION_WARNING_EMAIL_2" => "Wygląda na to, że nie korzystałeś ze swoich środków PamFax przez dłuższy czas. Staną się one nieaktywne, jeśli nie zostaną napoczęte w ciągu 180 dnia. Pozostało Ci <b>{days_to_expiration} dni</b>, nim twoje środki staną się nieaktywne.\n\nJak utrzymać stan środków jako aktywny?\nTo proste. Wykonaj jedną z poniższych czynności, a twoje środki będą aktywne przez kolejne 180 dni:\n\n- Wyślij dokument lub stronę tytułową (na prawidłowy lub nieprawidłowy numer)\n- Zakup pakiet doładowujący PamFax lub plan w naszym sklepie na {shop_url}",
"MSG_CREDIT_EXPIRATION_WARNING_EMAIL_3" => "Wygląda na to, że nie korzystałeś ze swoich środków PamFax przez dłuższy czas. Staną się one nieaktywne, jeśli nie zostaną napoczęte w ciągu 180 dnia. Pozostało Ci 48 godzin, nim twoje środki staną się nieaktywne.\n\nJak utrzymać stan środków jako aktywny?\nTo proste. Wykonaj jedną z poniższych czynności, a twoje środki będą aktywne przez kolejne 180 dni:\n\n- Wyślij dokument lub stronę tytułową (na prawidłowy lub nieprawidłowy numer)\n- Zakup pakiet doładowujący PamFax lub plan w naszym sklepie na {shop_url}",
"MSG_CREDIT_EXPIRATION_WARNING_MAIL_BODY" => "Wygląda na to, ze nie korzystałeś ze swoich środków PamFax przez dłuższy czas. Twoje środki wygasają, jeśli z nich nie korzystałeś przez 180 dni z rzędu. Pozostało ci <b>{days_to_expiration} dni</b>, aby wykonać operacje i zachować swoje środki.\n\nDane Twojego konta:\n\nNazwa PamFax: {username}\nStan środków: {credit}\n\n=== Jak aktywnie wykorzystywać stan swoich środków? ===\n\nPo prostu, wykonaj co najmniej jedna z poniższych operacji, a możliwość wykorzystania środków będzie przedłożona o kolejne 180 dni:\n\n- Wyślij dokument lub stronę tytułową faksu (na prawidłowy lub nieprawidłowy numer),\n- Doładuj konto PamFax (kliknij \"Doładuj konto PamFax\" w oprogramowaniu PamFax lub zakup pakiet doładowujący w naszym internetowym sklepie {website_url}shop).\n\n{email_footer}\n\n<p style='font-family: verdana, arial, helvetica, sans-serif; font-size: 10pt'>\n<i>Pomoc od PamFax</i>\nPonieważ nie możesz odpowiedzieć na ten e-mail, możesz się z nami skontaktować za pomocą naszego Helpdesku: {website_url}support\n\n<i>Chroń swoje hasło</i>\nObsługa PamConsult GmbH NIGDY nie zapyta się o Twoje hasło przez e-mail. Jedyne miejsca, w których jesteś pytany o hasło, to moment logowania do PamFax oraz przy zakupie lub sprawdzeniu konta na portalu. Logowanie do PamFax zawsze odbywa się za pomocą bezpiecznego połączenia, dlatego prosimy upewnić się, ze adres w przeglądarce wygląda na pewno tak {portal_url}. Powinien także być widoczny symbol kłódki, oznaczający bezpieczne połączenie.",
