"MSG_PLAN_EXPIRATION_WARNING_1" => "Twój numer faksu {number} wygaśnie w ciągu {days_to_expiration} dni ({expiration_date}). \n\n\n\nAby zachować twój numer faksu PamFax, odnów swoją subskrypcję teraz, postępując wg następujących kroków:\n\n\n\n1. Zaloguj się do portalu PamFax: https://portal.pamfax.biz\n\n2. Na górze strony zobaczysz swoje numer PamFax. Obok nich znajdować się będzie link \"Odnów subskrypcję\"\n\n3. Kliknij w link i postępuj zgodnie z instrukcją\n\n4. Po dokonaniu płatności ważność twojego numer faksu zostanie odnowiona, co można zaobserwować na portalu PamFax\n\n\n\nTwój numer ({number}) pozostanie wtedy aktywny, na kolejne 3 lub 12 miesięcy (zależnie od zakupy), wliczając w to nieograniczone odbieranie faksów.\n\n\n\nInformacja: Zakup nie wpłynie na twoje konto PamFax, środki PamFax oraz zdolność do wysyłania faksów. Plan jest osobną subskrypcją i nie jest powiązany z twoimi środkami PamFax na koncie.",
