"MSG_WARN_ACCOUNT_DELETION" => "Aby potwierdzić usunięcie konta PamFax kliknij w link:\n{deletion_link}\n\nJeśli uważasz, że ten e-mail to błąd lub że twoje konto zostało przechwycone przez nieautoryzowaną osobę, zaloguj się na <a href=\"{portal_url}\">Portalu PamFax</a>, aby zresetować swoje hasło.",
"MSG_WARN_EMAIL_CHANGED" => "Twój adres e-mailowy został zmieniony.\n\nStary adres e-mail: {old_email}\nNowy adres e-mail: {new_email}\n\nInformacja: Otrzymasz ten e-mail na obydwie skrzynki pocztowe.\n\nJeśli uważasz, że ten e-mail to błąd lub że twoje konto zostało przechwycone przez nieautoryzowaną osobę, zaloguj się na <a href=\"{portal_url}\">Portalu PamFax</a>, aby zresetować swoje hasło.",
"MSG_WARN_PASSWORD_CHANGED" => "Twoje hasło PamFax zostało zmienione.\n\nMożesz teraz zalogować się do <a href=\"{portal_url}\">PamFax</a>, wykorzystując swoją nazwę użytkownika PamFax \"{userlogin}\" i nowe hasło.\n\nJeśli uważasz, że ten e-mail to błąd lub że twoje konto zostało przechwycone przez nieautoryzowaną osobę, zaloguj się na <a href=\"{portal_url}\">Portalu PamFax</a>, aby zresetować swoje hasło.",
"MSG_WARN_USERNAME_CHANGED" => "Twoja nazwa użytkownika PamFax została zmieniona.\n\nStara nazwa użytkownika: {old_username}\nNowa nazwa użytkownika: {new_username}\n\nInformacja: Otrzymasz ten e-mail na obydwie skrzynki pocztowe.\n\nJeśli uważasz, że ten e-mail to błąd lub że twoje konto zostało przechwycone przez nieautoryzowaną osobę, zaloguj się na <a href=\"{portal_url}\">Portalu PamFax</a>, aby zresetować swoje hasło.",
"MSG_WELCOME_FAX" => "Witaj,\n\n<br><br>\n\n<p>Dziękujemy za zainstalowanie PamFax.</p>\n\n<p>Wysłaliśmy tobie pierwszy faks, tak abyś zobaczył, że twój numer rzeczywiście działa. Możesz teraz rozpocząć wysyłanie i otrzymywanie faksów z PamFax.</p><br>\n\n<p>PamFax oferuje teraz następujące korzyści:</p><br>\n\n<ol>\n\n<li>Darmowe aplikacje dla Microsoft Windows, Mac OSX, Android, iOS oraz Blackberry</li>\n\n<li>Proste wysyłanie faksów z Outlook 2007/2013 za pomocą darmowego dodatku dla Outlook'a</li>\n\n<li>Wysyłanie faksów bezpośrednio z Dropbox, Google Drive, OneDrive oraz Box</li>\n\n<li>Wysyłanie faksów na cały świat po atrakcyjnych cenach</li>\n\n<li>Płać na bieżąco przy pomocy zestawów doładowujących oraz subskrypcji</li>\n\n<li>Twoje środki PamFax nigdy nie ulegają przedawnieniu</li>\n\n<li>Wszystkie informacje są zaszyfrowane. Twoje dokumenty są bezpieczne</li>\n\n<li>Uczciwe i jasne warunki subskrypcji, np. nie pobieramy automatycznie opłaty za cokolwiek!</li>\n\n</ol><br>\n\n<p>Zarabiaj dodatkowe darmowe strony polecając PamFax znajomym. Za każdą osobę, która zarejestruje konto PamFax automatycznie otrzymasz darmową stronę do wysłania. Funkcja polecająca jest dostępna aplikacji PamFax po wysłaniu faksu lub z portalu PamFax. Im więcej polecisz, tym więcej stron możesz otrzymać!</p><br>\n\n<p>Mamy nadzieję, że polubisz naszą usługę. Jeśli masz jakieś pytania, skontaktuj się z nami przez kontakt z obsługą w serwisie PamFax na www.pamfax.biz lub wyślij do nas e-mail support@pamfax.biz.</p>\n\n<br>\n\nPozdrowiamy,<br><br>\n\nZespół PamFax",
