"TXT_REGMAIL_BODY" => "Witaj w ekscytującym świecie PamFax - nowy sposób faksowania. Twoje darmowe konto PamFax zostało pomyślnie utworzone.\n\nNazwa użytkownika PamFax: <b>{username}</b>\n\nWszystko zostało przygotowane do wysłanie twojego pierwszego faksu! Pierwsze 3 strony (do odbiorcy w <a href=\"{website_url}rates/costs/\">strefie 1</a>) <b>są za darmo</b>. Darmowe środki PamFax zostały dodane do twojego konta automatycznie.\n\nMożesz od teraz logować się do <a href=\"{portal_url}\">Portalu PamFax</a> za pomocą swojej nazwy użytkownika i hasła, i wysłać pierwszy faks!\n\nAby wysłać więcej faksów po prostu <a href=\"{shop_url}?addtobasket=Pack10\">doładuj środki PamFax</a> do swojego konta.\n\nJeśli chcesz także otrzymywać faksy i czerpać korzyści z nieograniczonej możliwości odbierania faksów, 20 darmowych stron w miesiącu do strefy 1 oraz wiele więcej, powinieneś rozważyć zakup naszego atrakcyjnego planu <a href=\"{shop_url}pamfax_professional_fax_plan\">PamFax Professional</a>.\n\nPotrzebujesz pomocy? Skontaktuj się z naszym <a href=\"{website_url}support\">działem obsługi</a>.\n\nNie usuwaj tego e-maila, może on być pomocny w przyszłości. Dziękujemy za dołączone do społeczności PamFax, mamy nadzieję, że będziemy służyć jak najlepiej.",
